import '../index.css';
import {Card,Button} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import CardTemplate from './CardTemplate'
function BlogCards() {
  return (
    <div className="Blog-section">
        <CardTemplate link='https://source.unsplash.com/random/1080/1920'/>
        <CardTemplate link='https://picsum.photos/1920/1080/'/>
        <CardTemplate link='https://picsum.photos/1080/'/>


    </div>
  );
}

export default BlogCards;
